import React from 'react';
import CardList from './Componentes/CardList';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
 const cardData = {
  logo: "https://peaku.co/img/company.svg",
  nombre: "Director comercial",
  habilidades: ["Business Analysis", "Commercial Relationship", "Commercial Strategy"],
  empresa: "Confidencial",
  lugar: "Bucaramanga",
  salario: "Confidencial",
  vacantes: "1 vacante",
  actualizado: "about 2 hours ago",
  beneficios: "certificaciones - fiesta de fin de año - capacitaciones",
 };


 return (
    <div className="App">
      <CardList cards={[cardData]} />
    </div>
 );
};

export default App;
